import React from "react";
import styled from "styled-components";

const Header = () => {
  return (
    <>
    <NavWrapper>
      <div>EN/JP</div>
      <div>About</div>
      <div>Map</div>
      </NavWrapper>
    </>
  );
};

const NavWrapper = styled.div`
display: flex;
flex-direction: row;
`;

export default Header
